    updateFileUrl(url)
    console.log(url)
  } catch (error) {
    console.log('Error uploading file: ', error)
  } 
}



async function authentify(e)
{
  try {
    latestblock= await web3.eth.getBlockNumber()-1;
  let json = `{"url":"${ipfsurl}",
  "links":{
